	function buildUniqueList(initialList,itemToAdd)
	{
		var found=false;
		for(iterator=0;iterator<initialList.length;iterator++)
		{
			if(initialList[iterator]==itemToAdd.trim())
			{
				found=true;
				break;
			}
		}
		if(found==false)
		{
			initialList.push(itemToAdd.trim());
		}
		return initialList;
	}
